import React, { useRef } from "react";

const SigninInsert=()=>
{   
    var textname = useRef();
    var textemail = useRef();
    var textpassword = useRef();

    const handleSubmit =(e)=>
    {
        e.preventDefault();
        console.log(textname)
    }
    return(
        <>
            <form method="post" onSubmit={handleSubmit}>
                <table cellPadding={5} cellSpacing={5} border={2}>
                    <tr>
                        <td>name</td>
                        <td><input type="text" ref={textname}/></td>
                    </tr>
                    <tr>
                        <td>Email</td>
                        <td><input type="text" ref={textemail}/></td>
                    </tr>
                    <tr>
                        <td>password</td>
                        <td><input type="text" ref={textpassword}/></td>
                    </tr>
                    <tr>
                        <td><input type="submit" /></td>
                    </tr>
                </table>
            </form>

        </>
    );
}

export default SigninInsert;
